import{_ as t,o,c as n,ah as r}from"./chunks/framework.PKn7PQPU.js";const b=JSON.parse('{"title":"Component Badges","description":"","frontmatter":{},"headers":[],"relativePath":"en/_common/start/sign.md","filePath":"en/_common/start/sign.md"}'),s={name:"en/_common/start/sign.md"};function d(i,e,a,c,g,l){return o(),n("div",null,[...e[0]||(e[0]=[r('<h1 id="component-badges" tabindex="-1">Component Badges <a class="header-anchor" href="#component-badges" aria-label="Permalink to &quot;Component Badges&quot;">‚Äã</a></h1><p>When browsing the TechUI component documentation, you will see specific <strong>Badge</strong> indicators next to the titles of some components.</p><p>TechUI always upholds the principles of honesty and respect. To clarify component ownership and design sources, we have established the following badge standards.</p><h2 id="badge-meanings" tabindex="-1">Badge Meanings <a class="header-anchor" href="#badge-meanings" aria-label="Permalink to &quot;Badge Meanings&quot;">‚Äã</a></h2><table tabindex="0"><thead><tr><th>Badge (Type)</th><th>Description</th><th>Applicable Scenarios / Properties</th></tr></thead><tbody><tr><td><strong>üèÜ Industry Pioneer</strong><code>ind</code></td><td><strong>Disruptive Innovation:</strong> <br>Indicates pioneering significance within <br>the entire frontend industry,breaking existing <br>technical boundaries or interaction patterns <br>(e.g., Frontend License).</td><td><code>danger</code><br>(Highlight Alert)</td></tr><tr><td><strong>üëë Pioneer</strong><code>1st</code></td><td><strong>TechUI Exclusive Invention:</strong> <br>Indicates the concept or implementation is <br>an industry first,and the code is completely <br>self-developed by the TechUI team. Represents <br>core innovation capability.</td><td><code>warning</code><br>(Gold Quality)</td></tr><tr><td><strong>üèÖ Original</strong><code>ori</code></td><td><strong>Self-Developed Code:</strong> <br>Although similar functions exist in the industry, <br>it is independentlydesigned and written by <br>TechUI, with 100% self-developed code.</td><td><code>warning</code><br>(Quality Assurance)</td></tr><tr><td><strong>‚≠ê Star</strong><code>star</code></td><td><strong>Highly Recommended:</strong> <br>Refers to core benchmark components with <br>excellent community feedback,most complete <br>functionality, or high usage frequency.</td><td><code>danger</code><br>(Key Focus)</td></tr><tr><td><strong>üíé Advanced</strong><code>adv</code></td><td><strong>High-Value Component:</strong> <br>Belongs to flagship components or specific <br>advanced feature sets,involving core business <br>logic or complex underlying technology.</td><td><code>primary</code><br>(Professional Authorization)</td></tr><tr><td><strong>üß¨ Ported from [Lib Name]</strong><code>port</code></td><td><strong>Tribute &amp; Replica:</strong> <br>Deeply referenced and ported from other <br>excellent open-source libraries.The original <br>author&#39;s copyright notice is retained and adaptation <br>optimizations are made during porting.</td><td><code>primary</code><br>(Open Source Compatible)</td></tr><tr><td><strong>üßä Enhanced</strong><code>enh</code></td><td><strong>Deep Customization:</strong> <br>Deep secondary development based on mature <br>third-party libraries, simplifyingcumbersome <br>configurations and injecting TechUI visual genes <br>to achieve out-of-the-box usage.</td><td><code>primary</code><br>(Usability Enhancement)</td></tr><tr><td><strong>üß™ Experiment</strong><code>exp</code></td><td><strong>Experiment Component:</strong> <br>First release, still in the testing phase. Component <br>contentsuch as appearance and Props may <br>change at any time. Use with caution.</td><td><code>success</code><br>(Subject to Change)</td></tr><tr><td><strong>üíõ Contributed by [Author]</strong><code>cont</code></td><td><strong>Community Contribution:</strong> <br>Indicates the component was contributed by a <br>community developer.If self-developed by the <br>contributor, it will be marked as <br><code>Original Contribution by [Author]</code>.</td><td><code>important</code><br>(Honorary Contribution)</td></tr><tr><td><strong>‚ö° WASM Powered</strong><code>wasm</code></td><td><strong>High-Performance Core:</strong> <br>Indicates the component&#39;s core calculation logic <br>is written in <code>Rust</code>and compiled to <code>Wasm</code>, <br>possessing extreme performance.</td><td><code>info</code><br>(Hardcore Tech)</td></tr><tr><td><strong>üßä WebGL/3D</strong><code>gl</code></td><td><strong>3D Rendering:</strong> <br>Indicates the component relies on Three.js or <br>native WebGLcontext. Usually has certain <br>requirements for the graphics card and belongs <br>to heavy visualization components.</td><td><code>info</code><br>(Visual Engine)</td></tr><tr><td><strong>üé® Pure CSS</strong><code>css</code></td><td><strong>Lightweight:</strong> <br>Indicates the component is implemented entirely <br>by CSS/SVG with no orminimal JS logic. Zero <br>dependencies, extremely low rendering overhead, <br>suitable for static decoration.</td><td><code>success</code><br>(Lightweight Efficient)</td></tr><tr><td><strong>üß† Logic Only</strong><code>logic</code></td><td><strong>No UI:</strong> <br>Indicates this is a &quot;headless&quot; component or Hooks, <br>providing onlyinteraction logic or data processing <br>capabilities, without specific UI styles.</td><td><code>warning</code><br>(Underlying Capability)</td></tr><tr><td><strong>üÜï New</strong><br><code>new</code></td><td><strong>Recently Released:</strong> <br>Indicates the component is a new member added <br>within the last 1-2 minor versions.Used to quickly <br>attract user attention in the sidebar or lists.</td><td><code>danger</code><br>(Fresh Release)</td></tr><tr><td><strong>‚è≥ Legacy</strong><br><code>leg</code></td><td><strong>End of Maintenance:</strong> <br>Indicates the component has reached the end <br>of its lifecycle and will be removedin a future version. <br>It is recommended not to use it in new features and <br>to migrate to alternatives as soon as possible.</td><td><code>default</code><br>(Gray/Outdated)</td></tr><tr><td><strong>‚õî Deprecated</strong><br><code>dep</code></td><td><strong>End of Maintenance:</strong> <br>Indicates the component is no longer recommended <br>for use and may be removedin a future version. Alternatives or migration guides are usually provided.</td><td><code>default</code><br>(Gray/Outdated)</td></tr></tbody></table><h2 id="unbadged-components" tabindex="-1">Unbadged Components <a class="header-anchor" href="#unbadged-components" aria-label="Permalink to &quot;Unbadged Components&quot;">‚Äã</a></h2><p>You will find that the vast majority of basic components in the TechUI component library (such as Button, Input, Layout, etc.) <strong>do not have any badges</strong>.</p><p><strong>This does not represent plagiarism (&quot;grab-ism&quot;), but stems from the universality of design patterns.</strong></p><p>In the long history of frontend UI development, the interaction paradigms of many basic components have converged, making it difficult (and unnecessary) to trace their earliest origins:</p><ul><li><strong>Row+Col (Grid):</strong> First popularized by Bootstrap, now a standard feature of all UI libraries.</li><li><strong>Tree / Message:</strong> Interaction logic is deeply influenced by pioneers like Element UI.</li><li><strong>Button / Form:</strong> Belong to wrappers of Web standard controls.</li></ul><p>For these <strong>highly generalized</strong> components, TechUI adopts the approach of <strong>&quot;Reference Industry Standards + Independent Implementation Code&quot;</strong>, so no separate source badge is added.</p><h2 id="future-ecosystem-strategy" tabindex="-1">Future &amp; Ecosystem Strategy <a class="header-anchor" href="#future-ecosystem-strategy" aria-label="Permalink to &quot;Future &amp; Ecosystem Strategy&quot;">‚Äã</a></h2><p>TechUI&#39;s vision is to build an all-encompassing component ecosystem.</p><p>To allow the <strong>TechUI</strong> base library to quickly meet complex business needs, in future iterations, we may adopt a <strong>&quot;Grab-ism&quot;</strong> strategy‚Äîdirectly porting some market-proven, excellent open-source components (such as complex date pickers, rich text editors, etc.).</p><p>For such ported components, we will strictly abide by open-source licenses and mark them as <strong><code>Ported from [XXX]</code></strong> in a prominent position in the documentation to pay the highest tribute to the original authors.</p><p>We believe that only by standing on the shoulders of giants can we see further.</p>',16)])])}const h=t(s,[["render",d]]);export{b as __pageData,h as default};
